import java.io.*;import java.util.*;public class Main  {	public static void main(String[] args) {		Scanner sca = new Scanner(System.in);		int t = sca.nextInt();		int [] a = new int [(int)Math.pow(2, 15)];		while(t--!=0) {			int k = sca.nextInt();			if(a[0]==0) a[++a[0]] = k;			else {				int temp = a[0];				for(int i=temp/2+1;i<=temp;i++) {					a[++a[0]] = a[i] - k;					a[++a[0]] = a[i] + k;				}			}		}		for(int i=a[0];i>=a[0]/2+1;i--) {			if(a[i]==0||a[i]%360==0) {				System.out.println("YES");				break;			}			if(i==a[0]/2+1) {				System.out.println("NO");			}		}	}}
